data.text:
@Al_ber2 Que mierda, obvio.
Llorar de frustración, de pensar 'estudie en la universidad llena de sueños y aquí estoy sin posibilidad alguna'.
Hay gente que se suicida por eso.

@TadeuVieira15 Não acho que ele esteja “pouco se fudendo”. Mas que está devendo nessa passagem, está! 

Não falo nem pelos resultados, mas pela falta de alternativas táticas. 

Ou joga no erro, ou não joga. E se o time dele erra, matou o estilo de jogo do Corinthians.

RT @ecoordina: OMS: Cada 40 segundos se suicida una persona. | 
